(60418, 156983, 5602, 1, '在一起', '', '2013-02-01 00:00:00', 2000, 19, 0, 4, '', '想跟你在一起 想跟你坐飛機 \n一起去旅行 一起看星星 \n看電影 喝咖啡(台) 台北走到巴黎 \n看你的眼睛 順便偷看你日記 \n還有好多的事情 \n\n在一起 BA LA LA LA LA BA LA LA LA LA \n然後 SHA LA LA LA LA SHA LA LA LA LA \n我和你有做不完的事情 \n\n在一起 BA LA LA LA LA BA LA LA LA LA \n然後 SHA LA LA LA LA SHA LA LA LA LA \n就這樣就算我們變成猩猩 \n\n還是一樣愛著你 永遠不會離開你 \n就算是香蕉母猩猩誘惑我只愛你呀 \n好東西我只想 想要跟你一起 \n只有我和你 沒有母猩猩 \n\n想跟你在一起 擁有許多回憶 \n回憶裡的你 永遠是美女 \n我只想要跟你 在一起 (在一起 在一起 在一起) \n\nTOGETHER BABY \nTOGETHER BABY \nTOGETHER BABY \n\n在一起 BA LA LA LA LA BA LA LA LA LA \n然後 SHA LA LA LA LA SHA LA LA LA LA \n我和你有做不完的事情 \n\n在一起 BA LA LA LA LA BA LA LA LA LA \n然後 SHA LA LA LA LA SHA LA LA LA LA \n就這樣就算我們變成猩猩 \n\n還是一樣愛著你 永遠不會離開你 \n就算是香蕉母猩猩誘惑我只愛你呀 \n\nTOGETHER BABY \nTOGETHER BABY \nTOGETHER BABY \nTOGETHER BABY \n\n好東西我只想 想要跟你一起 \n回憶裡的你 永遠是美女 \n我只想要跟你 在一起', 227, '', '', '', '', '', '', 0, 1, 0, '2013-02-04 17:04:45', '2015-03-12 13:59:06', '0000-00-00 00:00:00'),
(60419, 172779, 5603, 1, '存在的力量（三立偶像劇「真愛黑白配」插曲）', '存在的力量/韓劇[我的野蠻情人]片頭曲\n\n朱俐靜第一首詞曲創作作品。創意來源是過去五年生活中，壓抑已久的點點滴滴，終於在第一天進錄音室收工後，徹底地爆發開來。那時候思緒澎湃奔騰，仿佛有著無限地力量，瞬間釋放。「存在的力量」是朱俐靜和自己的對話，是和她愛的人、愛她的人說話。強有力的音符伴隨著撼動人心的旋律，高亢的聲線猶如熾熱的陽光，帶給人無限的正向能量及療癒的溫暖。\n', '2013-03-28 00:00:00', 2000, 19, 0, 4, '存在的力量                詞曲 朱俐靜\nA1\n你又晚睡了嗎? 帶著早餐回家?\n又是一個人 一盞燈黃下 看著天亮了\n\nA2\n他說應該這樣 無謂猶豫掙扎\n太多吵雜 卻沒有個聲音給你 支撐的力量\n\nB1\n你只要 一個屬於你的地方 \n能用力 喊出你靈魂的真相\n是簡單平常 像孩子一樣 沒有該不該講\n\nB2\n為了 這一個屬於你的地方 \n就願意 不顧不想一切的代價\n就全力嘶喊吧 為你 存在的力量\n\nA3\n別說只有這樣 我想我們都一樣\n太多說法 只是因為害怕隱藏 最深的渴望\n\n2B1\n你只要 一個屬於你的地方 \n能用力 喊出你靈魂的真相\n是簡單平常 像孩子一樣 眼神透明閃亮\n\n2B2\n為了 這一個屬於你的地方 \n就願意 不顧不想一切的代價\n就全力嘶喊吧 飛翔 就算逆著光\n(就全力嘶喊吧 為你 存在的力量)\n', '', 229, '', '朱俐靜', '朱俐靜', '', '福茂唱片 LINFAIR RECORDS', '', 0, 1, 0, '2013-02-04 17:13:24', '2015-03-12 13:59:06', '0000-00-00 00:00:00'),
