(60422, 141235, 5555, 2, '無題', '無謂擺動，忽熱又冷', '2013-02-14 00:00:00', 2013, 20, 0, 4, '我想著他，看到了你\n飛上雲端，墜落谷底\n他的笑容，在你臉上\n\n我看著你，想到了他\n你的眼睛，跟他一樣\n無謂擺動，忽熱又冷\n\n為什麼上帝要捉弄我\n為什麼永遠都不放過我\n\n為什麼在我最好的時候\n祢不成全我', '', 173, '', '邱比', '邱比', '邱比 Chiu-Pi', 'Chiu-Pi / Gallery', '', 1, 0, 1, '2013-02-04 19:38:16', '2013-12-25 00:34:18', '2013-12-25 00:34:18'),
