(60430, 10597, 0, 1, '吳爾芙的房間', '', '2013-01-31 00:00:00', 2000, 20, 0, 4, '吳爾芙的房間\r\n\r\n點燃一根煙  轉眼就過了夏天\r\n你不見 誰出現\r\n留下     靜默的房間\r\n\r\n走了好遠  期待下一個夏天\r\n你不見 誰出現 \r\n回憶保存在那個空間\r\n\r\n風化了你的臉我的臉 侵蝕了我眼底你眉間\r\n我看不見 我看不見\r\n\r\n灰藍色的天  在暴風雨來臨以前\r\n潮濕的氣味  你和我和他的世界\r\n沒有什麼絕對  也沒有抱歉\r\n只留下一根菸  和一個空盪的房間\r\n\r\n灰藍色的天  在暴風雨來臨以前\r\n潮濕的氣味  你和我和他的世界\r\n沒有什麼絕對  也沒有抱歉\r\n只留下一根菸  和一個空盪的房間', '', 325, '', '樊哲忠', '王小凡', '小孩大人樂團', '', '', 0, 1, 0, '2013-02-05 02:22:23', '2015-03-12 13:59:06', '0000-00-00 00:00:00'),
