(60468, 91717, 0, 1, '你走', '', '2013-02-05 00:00:00', 2000, 0, 1, 7, '微風吹撫的蕭瑟之秋\n是你離開的時候\n飛機消失在雲的盡頭\n感官也隨之遠走\n\n回程彷彿無盡無窮\n伴著遺留下的靜默\n呼吸未散去的微香\n窒息的讓人心痛\n\nHey~ Always wonder\n等待的不是重逢\n是沒有盡頭的守候\n經過了多少狂歡\n無數的美好時光\n伴著你的身影\n微笑帶來黯然神傷\n而夜~依然很漫長\n\n徹夜的忙碌奔波\n暫時忘卻你的臉孔\n多少個春夏秋冬\n回首盡是寂寞\n\n偶然吹起的風\n是記憶中的悸動\n思念的淡淡微香\n化作濃郁的憂愁\n\nHey~ Always wonder\n在不同的角落\n作著隨風而逝的美夢\n夢醒只有惆悵\n徘徊不去你的臉龐\n所有思緒憂傷\n定格在某個地方\n重逢~依然是奢望\n', '', 209, '', '', '', '', '', '', 0, 1, 1, '2013-02-05 13:05:45', '2014-04-07 21:56:37', '2014-04-07 21:53:38'),
