(60595, 170190, 0, 1, '過了,忘了', '', '2013-07-31 00:00:00', 2013, 0, 2, 7, '過去了,我好像就忘記了\r\n我,心理只有未來\r\n我被蒙在鼓裡\r\n那份的快樂\r\n忘記的傷心\r\n腦袋一片空白\r\n\r\n我無法選擇性忘記\r\n快樂和傷心被帶走了吧\r\n其實 我沒忘記\r\n只是 找不到解釋的理由\r\n\r\n找不到 那份的記憶\r\n沒看到 它的影子\r\n以前不見了 未來是怎麼來的\r\n自然等待嗎?', '', 181, '', '', '', '', '', '', 0, 0, 1, '2013-02-05 19:17:47', '2013-10-07 17:23:56', '0000-00-00 00:00:00'),
