(60598, 168386, 0, 1, '暗戀白皮書 demo', '', '2013-02-05 00:00:00', 2000, 0, 2, 5, '暗戀白皮書   \n\n等寂寞在等待 等愛情 悄悄走來\n辭窮想對白 我總明白 說 不來\n是誰說愛情 總無聲靜賴  怎麼會 我聽見 心跳聲 在砰然不停  \n愛情交響樂 一個人陶醉  baby 一種彷彿聲線般的眷戀放肆蔓延\n\n異端的姿態 孤傲的崇拜 愛讓人 太淪陷 閉上眼 思念在發炎\n不安定靈魂 依然澎湃 我知道  我又想妳了\n冀望這一季秋 天琴座靠岸 許願付出 琉璃的心 就不再那麼遺憾\n\n信仰中 告解寬赦為愛        \n暗戀中 始作俑者淘汰\n說再濃 沒人能懂 渣狼黑(韓文我愛妳) 想讓你懂 渣狼黑~黑~黑~黑\n旋律中 音階踩著動脈\n節奏中 跳動我在等待\n阿~愛~愛  喜歡妳 我寫在 A4空白 立可白 撰寫表白\n                                                               \noh ~~ how~~oh~~~YA\n \n緣分太遙遠 太思念 停滯不前\n烏雲在凋謝 陰晴圓缺 在 浮現\n坐在小酒館 啜飲者空白 萊姆味 搭曖昧 點一杯 心痛的感覺     \n寂寞敲響夜 一個人喝醉   baby  月光灑下投影 妳~的~臉  \n小蘋果紅臉頰 褐色微捲髮 娃娃眼 太正點 嘟嘟嘴 像星辰在點綴\n不敢太靠近 怕妳洞悉 誤解了我的 別有用心 \n沒有感情依賴 不刻意打擾 是我溫柔 是我傻 還是不 懂妳正覺得困擾    \n\n信仰中  告解寬赦為愛        \n暗戀中  始作俑者淘汰  \n說再濃 沒人能懂 渣狼黑(韓文我愛妳) 想讓你懂 渣狼黑~黑~黑~黑\n旋律中 音階踩著動脈\n節奏中 跳動我在等待\n阿~愛~愛  喜歡妳 我寫在 A4空白 立可白 撰寫表白\n\n惡夜散發著孤單危險的訊號 氣壓呢喃著嗜血愛情的味道\n深白色特務處決我心跳 白色鬱金香灌溉煎熬\n\n腦海中 投映你的可愛\n心扉中 掀起美麗期待\n怎麼愛 安排如此 短暫 倒數計時 54321\n人海中 迷惘地太厲害\n荒野中 我的真心曝曬\n阿~愛~愛  愛上你 這是我 完美作品 卻只錯在 愛上了你                                                                                                                \n', '', 265, '', '江孟翰', '林鴻智', '夏一跳樂團(Snmmer Jump)', '', '', 0, 1, 0, '2013-02-05 22:54:44', '2015-03-12 13:59:12', '0000-00-00 00:00:00'),
